import Link from 'next/link'


const Index = () => (
    <div>
        <Link href='/'>
            <a>Home</a>
        </Link>
        &nbsp;
        <Link href='/blog'>
            <a>Blog</a>
        </Link>
    </div>
)

export default Index;
